(28, 'sinharaja', 'nature', 'sinharaja forest', '', '', '', 'mathara', '10', 0, '', '', '', 'http://localhost/TSLphoto/sinharaja.jpg', '', '', ''),
(29, 'sigiriya', 'cultural', 'sigiriya ,Dambulla', '', '', '', 'Dambulla', '10', 0, '', '', '', 'http://localhost/TSLphoto/sigiriya.jpg', '', '', ''),
(30, 'ucsc', '', '35\nreid avenue\ncolombo7', '', '', '', 'colombo', '56,34', 5, 'The University of Colombo School of Computing (UCSC) is a higher educational institute affiliated to the University of Colombo in Sri Lanka providing Computer Science and Information and Communication Technology education. The UCSC was formed on 1 September 2002 by bringing together the Department of Computer Science of the Faculty of Science of the University of Colombo and the Institute of Computer Technology and considered as the leading computing higher educational institution in Sri Lanka', '', '', 'http://localhost/TSLphoto/ucsc.jpg', '', '', ''),
(32, 'temple of tooth', 'cultural', 'rajamawatha \nkandy', '', '', '', 'kandy', '23,34', 4, 'Sri Dalada Maligawa or the Temple of the Sacred Tooth Relic is a Buddhist temple in the city of Kandy, Sri Lanka. It is located in the royal palace complex of the former Kingdom of Kandy, which houses the relic of the tooth of the Buddha. Since ancient times, the relic has played an important role in local politics because it is believed that whoever holds the relic holds the governance of the country. Kandy was the last capital of the Sri Lankan kings and is a World Heritage Site mainly due to the temple.', 'After the parinirvana of Gautama Buddha, the tooth relic was preserved in Kalinga and smuggled to the island by Princess Hemamali and her husband, Prince Dantha on the instructions of her father King Guhasiva.[2] They landed in the island in Lankapattana during the reign of Sirimeghavanna of Anuradhapura (301-328) and handed over the tooth relic. The king enshrined it Meghagiri Vihara (present day Isurumuniya) in Anuradhapura. Safeguard of the relic was a responsibility of the monarch, therefore over the years the custodianship of relic became to symbolize the right to rule. Therefore, reigning monarchs built the tooth relic temples quite close to their royal residences, as was the case during the times of the Anuradhapura Kingdom, Kingdom of Polonnaruwa, and Kingdom of Dambadeniya. During the era of the Kingdom of Gampola, the relic was housed in Niyamgampaya Vihara. It is reported in the messenger poems such as Hamsa, Gira, and Selalihini that the temple of tooth relic was situated within the city of Sri Jayawardenepura Kotte when the Kingdom of Kotte was established there.', 'During the reign of Dharmapala of Kotte, the relic was kept hidden in Delgamuwa Vihara, Ratnapura, in a grinding stone.[2] It was brought to Kandy by Hiripitiye Diyawadana Rala and Devanagala Rathnalankara Thera. King Vimaladharmasuriya I built a two-storey building to deposit the tooth relic and the building is now gone.[3] In 1603 when the Portuguese invaded Kandy, it was carried to Meda Mahanuwara in Dumbara. It was recovered in the time of Rajasinha II and it has been reported that he reinstate the original building or has built a new temple.[2] The present day temple of the tooth was built by Vira Narendra Sinha.[4] The octagonal Patthirippuwa and moat was added during the reign of Sri Vikrama Rajasinha. Famous Kandyan architect Devandra Mulacharin is credited with building the Patthirippuwa. Originally it was used by the kings for recreational activities and later it was offered to the tooth relic. Now it is a library. It was attacked on two occasions, the 1998 Temple of the Tooth attack by the militant organization Liberation Tigers of Tamil Eelam[1] and the 1989 Temple of the Tooth attack by the Janatha Vimukthi Peramuna', 'http://localhost/TSLphoto/templeoftooth.jpg', '', '', ''),
(33, 'Galleface', 'beach', 'Gallface,\r\nGalle Road, \r\nColombo 3', '', '', '', 'colombo', '', 4, 'The Galle Face is a five hectare ocean-side urban park, which stretches for a half kilometre along the coast, in the heart of the financial and business district of Colombo, Sri Lanka', '', '', 'http://localhost/TSLphoto/galleface.jpg', '', '', ''),
(34, 'Gangarama temple', 'cultural', '61 Sri Jinarathana Rd, \r\nColombo 2', '', '', '', 'colombo', '', 4, 'Gangaramaya Temple is one of the most important temples in Colombo, Sri Lanka, being a mix of modern architecture and cultural essence.', '', '', 'http://localhost/TSLphoto/ganga.jpg', '', '', '');

