INSERT INTO `posts` (`post_id`, `post_content`, `post_date`, `post_topic`, `post_by`) VALUES
(4, 'This was part of two days trip and first day we conquered Meeriyagolla Mountain (?????????? ????) who is a neighbor of Lakegala-Narangamuwa. Then we trekked to Meemure and spent the night there. Next day we reserved for Kota Ganga Falls expedition.\nKota Ganga Falls is a cascade of 6+more waterfalls can be seen well at Rangala area. This Kota Ganga flows from Knuckles range. The basic of visiting this waterfall complex is either getting down from Knuckles area to Kota Ganga village or climbing up from Kota Ganga village to Knuckles-Thangappuwa.\nWe choose the first option. Ruvinda and myself reached the Corbet’s gap around 7am from Meemure. It was the ideal time to enjoy the beauty of Corbet’s gap.', '2016-11-21 22:42:35', 6, 7),
(5, 'This was my 11th visit to Sri pada and third off season hike. No matter how often I visit this sacred mountain I never get enough as this Sri pada Sanctuary is the best place on earth by means of bio Diversity and uniqueness. If I say one should hike this holly peak to experience the real beauty and the mystery in off season, it would be a controversial statement. Though my statement is 100% true if a brainless, irresponsible person do this hike in off season it would be a disaster for this precious area. Even your breath is a pollutant to this sensitive eco system, then what about polythene, plastic etc.. So my sincere request for the hikers not to harm this beautiful place any means. Remember leave only foot prints and take only photographs\r\n\r\nSince our crew was only two I thought of doing this as one day hike. Then problem aroused what we are going to do next day as it was a free day for both of us. Then I remembered the beautiful peak bopaththalawa which I was planning to do from a long time. While Most of the people rest for weeks after a hike to Sri pada, my friend Thenuka accept the challenge to climb \r\nBapaththalawa very next day. So we successfully did both peaks in two consecutive days followed by a scenic drive to Balangoda. So here is the story of our journey.\r\n\r\nI left home around 5.00 am and reached Avisawella 7.00 a.m. Thenuka came from his car around 7.15 and we drove towards Nallathanni. Drive was in a slow side as we were not in a hurry. We reached Nallathanni around 10.00 a.m. and parked vehicle at Nagawiharaya (where a tall Buddha Statue stands) we started the hike from Nallathanni Bridge around 10.15 a.m. Iâ€˜ll let pictures to tell the remaining story', '2016-11-22 16:24:02', 7, 2),
(6, 'sahsjahsajsa', '2016-11-24 12:49:06', 8, 2),
(7, 'You can borrow any camping tents, sleeping bags, BBQ drills for low prices in the following shops. \r\nKumara Tents: Moratuwa tel: 077-5694524\r\nBackpackers : Dehiwala tel:071-4588414', '2016-11-27 22:07:25', 9, 7);

